import React from 'react'
import MoviesLists from './MoviesLists'
import data from './data.json'
import './App.css'

const App = () => {
  return (
    <>
    {
      data.map((value) => {
        return(
<MoviesLists 
title={value.Title}
year={value.Year}
runtime={value.Runtime}
img={value.Poster}
/>
)
      })
    }
    
    </>
  )
}

export default App
